import React from "react";
import Items from "./Items";
import "./App.css"

function App() {
  var mor_items = ["Ayoub","Amal","Anas","Achraf"] 
  const denamique = mor_items.map(e=><Items items={e} /> ) 
  return (
    <div className="App"> 
       <Items items="Kamal" /> 
       <Items items="Reda" /> 

    </div>
  );
}

export default App;
